<!DOCTYPE html>
<html>
  <head>
    <meta charset="utf-8" />
    <meta name="viewport" content="initial-scale=1, width=device-width" />

    <link rel="stylesheet" href="./global.css" />
    <link rel="stylesheet" href="./index.css" />
    <link
      rel="stylesheet"
      href="https://fonts.googleapis.com/css2?family=Inter:wght@400;600&display=swap"
    />
    <link
      rel="stylesheet"
      href="https://fonts.googleapis.com/css2?family=Poppins:wght@400&display=swap"
    />
  </head>
  <body>
    <div class="instagram-home-page">
      <div class="instagram-home-page-inner">
        <div class="frame-parent">
          <div class="frame-group">
            <div class="profile-parent">
              <img
                class="profile-icon"
                loading="lazy"
                alt=""
                src="./public/profile.svg"
              />

              <div class="frame-container">
                <div class="fluentcellular-4g-24-filled-wrapper">
                  <img
                    class="fluentcellular-4g-24-filled-icon"
                    loading="lazy"
                    alt=""
                    src="./public/fluentcellular4g24filled.svg"
                  />
                </div>
                <div class="wrapper">
                  <a class="a">15:16</a>
                </div>
                <div class="vector-wrapper">
                  <img
                    class="vector-icon"
                    loading="lazy"
                    alt=""
                    src="./public/vector.svg"
                  />
                </div>
                <div class="frame-wrapper">
                  <div class="vector-parent">
                    <img
                      class="vector-icon1"
                      alt=""
                      src="./public/vector-1.svg"
                    />

                    <img
                      class="vector-icon2"
                      loading="lazy"
                      alt=""
                      src="./public/vector-2.svg"
                    />
                  </div>
                </div>
              </div>
            </div>
            <div class="frame-div">
              <div class="frame-parent1">
                <div class="frame-parent2">
                  <img
                    class="frame-child"
                    loading="lazy"
                    alt=""
                    src="./public/group-1.svg"
                  />

                  <div class="frame-wrapper1">
                    <div class="ellipse-parent">
                      <div class="frame-item"></div>
                      <img
                        class="frame-inner"
                        loading="lazy"
                        alt=""
                        src="./public/ellipse-4@2x.png"
                      />
                    </div>
                  </div>
                </div>
                <div class="frame-wrapper2">
                  <div class="your-story-parent">
                    <div class="your-story">Your story</div>
                    <div class="brosky-">_brosky_</div>
                  </div>
                </div>
              </div>
            </div>
          </div>
          <div class="frame-parent3">
            <div class="frame-parent4">
              <div class="frame-wrapper3">
                <div class="kbs-parent">
                  <a class="kbs">
                    <p class="p">0.00</p>
                    <p class="p">kb/s</p>
                  </a>
                  <div class="bxsbattery-parent">
                    <img
                      class="bxsbattery-icon"
                      loading="lazy"
                      alt=""
                      src="./public/bxsbattery.svg"
                    />

                    <div class="container">
                      <a class="a1">100%</a>
                    </div>
                  </div>
                </div>
              </div>
              <div class="frame-parent5">
                <div class="frame-wrapper4">
                  <div class="image-7-parent">
                    <img
                      class="image-7-icon"
                      alt=""
                      src="./public/image-7@2x.png"
                    />

                    <div class="ellipse-div"></div>
                  </div>
                </div>
                <img
                  class="image-6-icon"
                  loading="lazy"
                  alt=""
                  src="./public/image-6@2x.png"
                />
              </div>
            </div>
            <div class="frame-wrapper5">
              <div class="frame-parent6">
                <div class="frame-wrapper6">
                  <div class="frame-parent7">
                    <div class="frame-wrapper1">
                      <div class="ellipse-parent">
                        <div class="frame-item"></div>
                        <img
                          class="ellipse-icon"
                          loading="lazy"
                          alt=""
                          src="./public/ellipse-4-1@2x.png"
                        />
                      </div>
                    </div>
                    <div class="frame-wrapper1">
                      <div class="ellipse-parent">
                        <div class="frame-item"></div>
                        <img
                          class="ellipse-icon"
                          loading="lazy"
                          alt=""
                          src="./public/ellipse-4-2@2x.png"
                        />
                      </div>
                    </div>
                  </div>
                </div>
                <div class="princess-peach-parent">
                  <div class="princess-peach">princess_peach</div>
                  <div class="despicable-">Despicable_</div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
      <main class="frame-main">
        <div class="ellipse-parent1">
          <div class="frame-child4"></div>
          <div class="frame-child5"></div>
          <div class="frame-child6"></div>
        </div>
        <img class="frame-icon" alt="" src="./public/frame-3.svg" />

        <section class="frame-section">
          <div class="frame-parent8">
            <div class="my-profile-wrapper">
              <img
                class="my-profile-icon"
                loading="lazy"
                alt=""
                src="./public/my-profile@2x.png"
              />
            </div>
            <div class="frame-parent9">
              <div class="arty-crafty-510-wrapper">
                <div class="arty-crafty-510">Arty_crafty_510</div>
              </div>
              <div class="frame-parent10">
                <div class="image-8-wrapper">
                  <img
                    class="image-8-icon"
                    loading="lazy"
                    alt=""
                    src="./public/image-8@2x.png"
                  />
                </div>
                <div class="isaintjames-la">Isaintjames . La Vida</div>
              </div>
            </div>
          </div>
          <div class="frame-wrapper9">
            <div class="image-10-parent">
              <img
                class="image-10-icon"
                loading="lazy"
                alt=""
                src="./public/image-10@2x.png"
              />

              <img
                class="image-11-icon"
                loading="lazy"
                alt=""
                src="./public/image-11@2x.png"
              />

              <img
                class="create-icon"
                loading="lazy"
                alt=""
                src="./public/create.svg"
              />

              <img
                class="image-10-icon"
                loading="lazy"
                alt=""
                src="./public/image-12@2x.png"
              />
            </div>
          </div>
        </section>
        <img
          class="image-icon"
          loading="lazy"
          alt=""
          src="./public/image@2x.png"
        />
      </main>
    </div>
  </body>
</html>
